import React, { Component } from "react";
import "./Home.css";
import PlayerChevron from "../components/PlayerChevron"



class Table extends Component{
    constructor(props) {
        super(props);
        console.log('ts called');

       // this.state.gameData = {}


       this.createPlayers = this.createPlayers.bind(this);
      }

    componentDidMount() {
        //this.seats = this.props.gameData.seats;
        this.createPlayers();  
        console.log(this.props)

    }
    createPlayers() {
        const seats = [{userid:'mike',balance:"10"},{userid:'jim',balance:"10"},{userid:'mike',balance:"10"}];
        const chevrons = [];
        //const seats = ;
        this.chevrons = Object.keys(seats).map(function(i) {
            return <PlayerChevron name={this.props.seats[i].userid} balance={this.props.seats[i].balance}></PlayerChevron>
        })
}

render () {
  return (
    <div className="Table">
       {this.props.jim}
       {JSON.stringify(this.props.seats)}
       {this.chevrons}
       <PlayerChevron name={this.props.seats[0].userid} balance={this.props.seats[0].balance}></PlayerChevron>
       <PlayerChevron name={this.props.seats[1].userid} balance={this.props.seats[1].balance}></PlayerChevron>
       <PlayerChevron name={this.props.seats[2].userid} balance={this.props.seats[2].balance}></PlayerChevron>
       <PlayerChevron name={this.props.seats[3].userid} balance={this.props.seats[3].balance}></PlayerChevron>
       <PlayerChevron name={this.props.seats[4].userid} balance={this.props.seats[4].balance}></PlayerChevron>
       <PlayerChevron name={this.props.seats[5].userid} balance={this.props.seats[5].balance}></PlayerChevron>
       <PlayerChevron name={this.props.seats[6].userid} balance={this.props.seats[6].balance}></PlayerChevron>
       <PlayerChevron name={this.props.seats[7].userid} balance={this.props.seats[7].balance}></PlayerChevron>

    </div>
  );
    }
}

export default Table
